INSERT INTO `place` VALUES (0,'인문(문화/예술/역사)','064-760-6331','다리/대교','서귀포시','중문동','선임교','제주특별자치도 서귀포시 중문로105번길 37 (중문동)','건축/조형물','제주도','https://th.bing.com/th/id/OIP.4DUvRcDSklwyJM920kc2BgHaEK?w=305&h=180&c=7&r=0&o=5&dpr=1.25&pid=1.7','126.4171','33.2517','천제연 폭포 위쪽에 있는 아치형의 선임교는 칠선녀다리라고도하며, 국내최초로 고유의 오작교 형태로 건설되었고 양쪽면에 각각 다른 악기를 든 선녀들이 구름을 타고 하늘로 올라가는 아름답고 웅장하게 조각된 일곱선녀상이 새겨져 있다. 구름다리, 선녀다리, 칠선녀다리, 칠선녀교, 선임교 등으로 불리워지는 것 만큼이나 유명하다. 칠선녀교라고도 하는 선임교(仙臨僑)는 천제연의 2단과 3단폭포 중간쯤에 위치해 폭포와 중문관광단지를 이어주는 아치형 철제다리이다.국내 최초로 우리 고유의 오작교 형태로 꾸며놓은 선임교 양쪽 옆면에는 칠선녀의 전설을 살려 각각 다른 악기를 든 아름답고 웅장하게 조각된 일곱 선녀상이 있으며, 한 개의 길이가 20미터나 되는 14개의 선녀상은 방문객들의 눈길을 끈다. 다리 길이는 128m이고 폭4m로 230톤 무게를 견딜 수 있다. 또한, 야간 관광에 대비하여 1백개 난간사이에 34개의 석등이 설치되어 있다.','1',NULL),(1,'인문(문화/예술/역사)','032-760-6440','유명건물','중구','해안동1가','구 일본우선(郵船)주식회사 인천지점','인천광역시 중구 제물량로218번길 3 (해안동1가)','건축/조형물','인천','https://th.bing.com/th/id/OIP.YZzoC5w1E7AZ1DIkvZHU5AHaE-?w=282&h=189&c=7&r=0&o=5&dpr=1.25&pid=1.7','','','구 일본우선주식회사 인천지점(舊 日本郵船株式會社 仁川支店)은 개항 이후 인천의 해운업을 독점하였던 일본우선주식회사의 인천지점으로 대한민국의 국가등록문화재 제248호이다. 현재 인천아트플랫폼 아카이브로 활용되고 있다. 1883년 4월에 우편기선 미쓰비시회사(郵便汽船 三菱會社) 부산지점의 인천출장소로 개설되었다. 이후 1885년 10월에 우편기선 미쓰비시회사와 공동운수회사가 합병되어 일본우선주식회사가 설립되자 1886년 7월 16일에 일본우선주식회사 인천출장소는 인천지점으로 승격되었다.\r\n\r\n건물의 준공 시기는 1888년 말에서 1889년 초로 추정되며 현존하는 대한민국의 근대건축물 중에서 가장 이른 시기에 속한다. 1915년 이후 건물은 매각되어 몇차례 건물주가 바뀌지만 해운업에 종사하는 인물들에게 매각되었기 때문에 계속 해운회사의 사무실로 사용되었다. 광복 이후에도 해운관련 회사의 업무용 건물로 사용되다가 최근 리모델링을 거쳐 인천아트플랫폼의 아카이브로 사용되고 있다.','2',NULL),(2,'인문(문화/예술/역사)','063-454-3337','기념탑/전망대','군산시','성산면','진포대첩 기념탑','전북 군산시 성산면 성덕리 421-4 금강호시민공원','건축/조형물','전라북도','https://th.bing.com/th/id/OIP.ntFkoCnw1q7oerIn34-8eAHaEy?w=269&h=180&c=7&r=0&o=5&dpr=1.25&pid=1.7',NULL,NULL,'진포대첩기념탑 우리나라 최초로 화약을 이용한 함포로 왜구 500여척을 무찌른 최무선의 진포대첩을 기리기 위해 세워진 탑이다. 금강호 시민공원의 중앙 광장 옆에 높이 17.9m 화강암으로 만들어진 진포대첩비가 서있다. 진포대첩이란 고려말 우리고장 군산에서 있었던 전투로 우리나라 역사상 최초로 화로를 사용하여 적을 물리친 전투를 말한다. 1999년 개항 100주년을 기념하여 만든 것인데 돛을 상징하는 큰 화강암 날개 모양이 하늘을 향해 솟아있고 두 조형물이 만나는 가장 높은 곳에 진포대첩에서 왜구를 쳐부순 화포가 하늘을 향해 화구를 겨누고 있다. 우왕 6년 8월 왜선 500여척이 진포에 침입하였다. 이때 침입한 왜구는 최소 25,000여 명의 대병력이었다. 이때 고려 조정에서는 나세, 심덕부, 최무선 등의 장군들로 하여금 최무선이 설계한 80여척의 병선과 역시 최무선이 만든 우리나라 최초의 화약병기인 화통, 화포를 갖추고 적을 소탕하였다.','3',NULL),(3,'인문(문화/예술/역사)','031-887-2868','기념탑/전망대','여주시','','여주 현충탑','경기도 여주시 주내로 98-6','건축/조형물','경기도','https://th.bing.com/th/id/OIP.ekOrcHgu8ieG4Yxfrfz7LQEyDM?w=282&h=188&c=7&r=0&o=5&dpr=1.25&pid=1.7',NULL,NULL,'경기도 여주시가 국가와 민족을 위해 산화한 호국 영령들을 추모하기 위해 건립한 현충탑이다. 1959년 6월에 건립하였으나, 시설 규모가 작고 부지가 좁아 2005년 6월 1일 다시 세웠다. 원래 1959년에 군민 성금으로 착공해 제막하였다가, 1980년에 개축하였다. 그 뒤 시설 규모가 작고 부지가 협소해 현충일 추도행사 등 참배에 불편하다는 여론에 따라 2004년 2월부터 전면 재공사를 시작해, 이듬해 현충일에 제막식을 가졌다. 현충탑은 조각가 이경순(李慶順)의 작품이다. 여주 도자기의 곡선미를 살리고, 여기에 여의주를 문 용의 몸짓을 소총 형상으로 표현하였다. 현충탑 뒷면에는 호국영령들의 위패벽이, 좌우에는 호국용사상이 설치되어 있다. 탑을 다시 세우면서 14위를 추가해 총 958위의 위패가 안치되어 있다. 해마다 1월 1일 아침과 현충일에 군민 추도 및 참배 행사가 열린다. 부지 면적은 500평이다.','4',NULL),(4,'인문(문화/예술/역사)','031-677-1330','기념탑/전망대','안성시','양성면','박승완선생 기념탑','경기도 안성시 양성면 속말길 2','건축/조형물','경기도','https://th.bing.com/th/id/OIP.Ehd7ao2mnNAjmvP7-wqvFAHaE8?w=252&h=180&c=7&r=0&o=5&dpr=1.25&pid=1.7',NULL,NULL,'대한민국 최고 국민훈장 사훈 기념탑\r\n재일교포로써 한국의 산업발전과 일본정부로부터 최초로 한국교포학교 승인을 취득하여 국내외로 다방면에서 국가의 위상을 위해 애쓰신 분이시다.\r\n1979년 사회복지 민간조직 육성발전에 기여한 공로로 박정희 대통령으로부터 국민훈장 모란장을 수여받았으며 1993년 일본정부로부터 정규학교 인가취득으로 학원재정 문제해결을 한 공로로 김영상 대통령으로부터 국민훈장 무궁화장을 수여받았다.\r\n일본 내 한국교포학교 위원회 회장을 역임하면서 오사카 시장으로부터 정규학교 인가를 취득하면서 교포학교가 건립되게 되었다.\r\n2001년 작고하신 후 자손들이 업적을 기리기 위해 기념탑을 세웠다.','5','6'),(5,'인문(문화/예술/역사)','033-250-3668','기념탑/전망대','춘천시','우두동','충렬탑(강원)','강원 춘천시 우두동 산1','건축/조형물','강원도','https://th.bing.com/th/id/OIP.QJssHAD1IF3XlH8K7lOQyADYEg?w=142&h=189&c=7&r=0&o=5&dpr=1.25&pid=1.7',NULL,NULL,'충렬탑이 자리한 우두산 지역은 6·25 개전 초기(1950.6.25～6.28)국군 제2군단의 창설 모체부대였던 제6사단 장병들이 애국적인 춘천시민과 한 덩어리가 되어 인해전술의 파상공격을 자행해 온 북괴군 제2군단 예하 제2, 제7사단의 주력을 섬멸함으로써 한국전쟁 초기 전선에서 유일하게 승전보를 올렸던 유서깊은 곳이다. 당시 북괴가 춘천 및 우두산 전투에서 대패함으로써 속전속결의 남침계획에 결정적 타격을 주었고, 적 제2군단장이 전격 해임되는 등 6.25 전사상 가장 빛나는 전승의 기록을 남겼던 전적지이다. 특히, 이 당시 전투에서 춘천시민, 학도호국단학생 그리고 제사공장 여성근로자들이 국군장병과 더불어 탄약을 운반하고 전투에 참가하는 등 시산혈해의 격전을 벌여 빛나는 승리를 가져옴으로써, 민·관 총력전의 귀감이 되었을 뿐만 아니라, 이곳 주민들의 뜨거운 반공 애국정신과 자유 수호 의지를 만천하에 드높였던 성스러운 곳이다. 6·25당시 전사한 호국영령을 추모하기 위해 1955년 3군단 제29사단 장병들이 건립하였으며, 매년 6. 6일 현충일 행사가 실시되고 있다.','6',NULL),(6,'인문(문화/예술/역사)','063-454-3337','터널','군산시','해망동','군산 해망굴','전라북도 군산시 군산창2길 48 (해망동)','건축/조형물','전라북도','https://th.bing.com/th/id/OIP.Hg8ATOruuT9zlFlKUIQizQHaE6?w=284&h=189&c=7&r=0&o=5&dpr=1.25&pid=1.7',NULL,NULL,'해망굴은 1926년 군산 중앙로와 수산업 중심지 해망동을 연결하기 위해 만든 토목 구조물로 높이 4.5m, 길이 131m의 반원형 터널이다.\r\n\r\n일제강점기에는 군산신사, 신사광장(현 서초등학교), 공회당, 도립군산의료원, 안국사(현 흥천사) 등이 인근에 있어 교통의 요충지였다. 한국전쟁 중에는 북한군 지휘본부가 해망굴 안에 자리하여 연합군 공군기의 공격을 받았고 그 흔적이 지금까지 남아있다.\r\n\r\n군산의 근현대사를 보여주는 소중한 문화유산이다.','7',NULL),(7,'인문(문화/예술/역사)','033-250-3668','기념탑/전망대','춘천시','삼천동','춘천지구 전적비(춘천지구 전적기념관)','강원도 춘천시 수변공원길 45 (삼천동)','건축/조형물','강원도','https://th.bing.com/th/id/OIP.a5uwJwZFEvmHt97If6x1JAHaEo?w=259&h=180&c=7&r=0&o=5&dpr=1.25&pid=1.7',NULL,NULL,'한국전쟁 때 국군 6사단이 치열한 방어전을 펼쳤던 춘천지구전투를 기념하기 위해 만든 전적비이다. 춘천 지구에 배치된 6사단 7연대는 SU - 76 자주포부대를 앞세우고 침입한 적 2사단을 춘천의 북쪽 관문인 소양강교를 중심으로 소양강방어선을 구축하고 굳세게 막았다. 대전차포중대의 소대장인 심일 소위가 대전차포와 육탄 공격으로 적 자주포를 파괴한 것도 바로 이때였다.홍천 지구에 배치된 6사단 2연대도 자주포부대와 T-34 전차를 선두로 침입한 적 12사단을 막아 싸웠다.\r\n홍천 북쪽 말고개를 중심으로 방어선을 구축하고, 특공대를 편성해 적 자주포와 전차를 파괴하며 효과적인 지연전을 수행한 것이다. 춘천·홍천 지구의 방어전은 서울에 북한군이 진입한 6월 28일까지도 성공적으로 지속됐다. 그러다가 육본의 지시로 부대 편제를 유지한 채 28일 오후부터 원주 방면으로 후퇴했다. 적의 파상적인 공격을 막아내며 치명적인 타격을 가한 춘천·홍천 지구 전투는 6·25전쟁 개전 직후 아군이 방어전에서 승리한 유일한 전투였다. 이로써 북한군의 기습 공격 전략에 일대 타격을 줬을 뿐만 아니라 아군의 주력이 한강방어선을 형성하고, 유엔군이 참전할 수 있는 시간적 여유를 벌어준 매우 귀중한 승전이었다.','8','3'),(8,'인문(문화/예술/역사)','064-760-3471','다리/대교','서귀포시','법환동','새섬 새연교','제주특별자치도 서귀포시 남성중로 40 (서홍동)','건축/조형물','제주도','https://th.bing.com/th/id/OIP.BRviozkAzYR87HGbpjbuYQHaE7?w=284&h=189&c=7&r=0&o=5&dpr=1.25&pid=1.7',NULL,NULL,'제주 서귀포항과 새섬사이에 제주의 전통 떼배인 \'테우\'를 모티브로 형상화한 대한민국 최남단ㆍ최장의 보도교인 \'새연교\'가 2009년 9월 28일 개통됐습니다.\r\n\r\n새연교의 건설은 서귀포항이 시드니와 나폴리에 못지않은 세계적 미항으로 도약하는 소중한 의미가 있습니다.\r\n\r\n\r\n새연교는 국내에서는 최초로 외줄케이블 형식의 길이 169ｍ, 폭 4~7ｍ의 사장교(斜張橋)로, 바람과 돛을 형상화한 높이 45ｍ의 주탑 등에 화려한 LED 조명시설까지 갖췄다.\r\n\r\n새연교를 걸으며 바라보이는 서귀포항을 비롯해 문섬, 범섬 등의 서귀포 앞바다와 한라산의 풍경은 절묘하다.\r\n\r\n또한, 쉽게 드나들 수 있게 된 총면적 10만 2천여㎡의 무인도인 새섬은 난대림 보호구역으로 지정된 새섬의 생태를 관찰할 수 있을 뿐만 아니라 1.2㎞의 산책로와 광장, 목재데크로(路), 자갈길ㆍ숲 속 산책로, 테마 포토존 등 다양한 편의시설이 꾸며졌다.\r\n\r\n특히, 새연교가 개통됨에 따라 새섬 도시 자연공원을 전면 개방되어 제주도 서귀포의 새로운 관광명소로 떠오르고 있으며, 연주회 등 다양한 행사가 열린다.\r\n','9',NULL),(9,'인문(문화/예술/역사)','032-745-8200','다리/대교','중구','운남동','인천대교','인천광역시 중구 인천대교고속도로 3 (운남동)','건축/조형물','인천','https://th.bing.com/th/id/OIP.ievLtz11ae14XWlL4tlrqwHaE4?w=284&h=188&c=7&r=0&o=5&dpr=1.25&pid=1.7',NULL,NULL,'인천광역시에 위치한 다리로, 연수구 송도국제도시와 인천국제공항의 소재지 중구 영종도를 잇는 다리이다. 대한민국 최장거리 교량으로 총 연장 21.38km이다. 사장교 구간 최대경간장은 800m로 대한민국에 있는 사장교 중 1등[1]이며, 주탑 높이는 238.5m, 상판의 최대높이는 74m이다. 2005년 6월에 착공에 들어가 2009년 10월 16일에 개통했다. 왕복 6차로이다.(가변차로가 존재하기 때문에 실제로는 왕복 8차로이다.)\r\n\r\n본 교량의 명칭 선정 당시 진행된 시민공모 결과 \'송도국제대교\'가 1위를 했지만, 명칭심사위원회와 지명위원회 심사 결과를 거쳐 최종 명칭은 설문조사 결과 2위를 차지한 인천대교로 확정되었다.#\r\n\r\n제2경인고속도로의 일부이지만 도로명주소로는 \"인천대교고속도로\"라는 별도 명칭을 부여하고 있다. 관리하는 기업은 인천대교주식회사이다.\r\n\r\n인천광역시 남부 지역, 수도권 남부 지역, 비수도권 지역, 서울 서남부권 일부(금천구, 관악구) 등의 인천공항 접근성을 개선하기 위해 계획되었다.\r\n\r\n사진을 잘보면 사장교 구간이 매우 높다. 큰 배가 자주 드나드는 인천항의 관문을 떡하니 막고 있기에 이렇게 시공되었다. 주탑 높이는 한때 사장교 중 세계 1, 2위를 기록했던 주경간장 890m의 일본 타타라대교(주탑높이 220m)나 주경간 856m의 프랑스의 노르망디교(주탑높이 205m)의 그것들보다도 높다. 상판이 가장 높이 올라간 사장교 주경간 가운데 구간만 해발 74m에 달한다. 20층 높이의 아파트(약 60m 정도)보다도 훨씬 높은 셈. 아울러 인천항을 드나드는 선박의 항로와 직각으로 교차할 수 있도록[2] 선형이 직선이 아닌 곡선으로 설계되었다.\r\n\r\n삼성물산 건설부문이 시공했다.\r\n','10','2'),(10,'인문(문화/예술/역사)','032-899-2214','다리/대교','옹진군','','부아산 구름다리','인천 옹진군 자월면 이작리','건축/조형물','인천',NULL,NULL,NULL,NULL,NULL,NULL),(11,'인문(문화/예술/역사)','02-511-7345','기념탑/전망대','강남구','압구정동','한남 새말카페 레인보우','서울특별시 강남구 강남대로 708 (압구정동)','건축/조형물','서울',NULL,NULL,NULL,NULL,NULL,NULL),(12,'인문(문화/예술/역사)','051-2205-8912','분수','사하구','다대1동','다대포 꿈의 낙조분수','부산광역시 사하구 몰운대1길 52 (다대동)','건축/조형물','부산',NULL,NULL,NULL,NULL,NULL,NULL),(13,'인문(문화/예술/역사)','1588-1234','유명건물','해운대구','우동','신세계센텀시티','부산광역시 해운대구 센텀남대로 35 (우동)','건축/조형물','부산',NULL,NULL,NULL,NULL,NULL,NULL),(14,'인문(문화/예술/역사)','02-22